//- THREE EMITTER

function initLibThreeEmitter(){
    THREE.Emitter = THREE_Emitter;
}
function THREE_Emitter(_settings){

    let i;

    //-

    _settings = Object.assign({

        quantity 		: 20,
        frequency 		: 0,

        world 			: {type:"rect", x:-100, y:-100, z:-100, wx:200, wy:200, wz:200},
        spawn 			: {type:"rect", x:0, y:0, z:0, wx:0, wy:0, wz:0},

        lifeframe 		: {min:200, max:300},
        scale 			: {x:1, y:1, z:1, dx:0, dy:0, dz:0, sync:true},
        rotation 		: {x:0,y:0, z:0,  dx:0, dy:0, dz:0},
        opacity 		: {a:1, da:0, easeIn:false},
        cloneMaterial 	: false,

        physics 		: false,

        gravity 		: {x:0, y:0, z:0},
        friction 		: {x:0, y:0, z:0, sx:0, sy:0, sz:0, rx:0, ry:0, rz:0, opacity:0},

        velocity 		: {x:0, y:0, z:0, dx:0, dy:0, dz:0},
        velocityScale 	: {x:0, y:0, z:0, dx:0, dy:0, dz:0, sync:true},
        velocityOpacity : {a:0, da:0},
        velocityAngular : {x:0, y:0, z:0, dx:0, dy:0, dz:0},

    }, _settings);

    //-

    let _emitter = new THREE.Group();
    _emitter.v_counter = 0;
    _emitter.v_settings = _settings;
    _emitter.v_tm = 0;
    _emitter.arr_particles = [];
    _emitter.arr_emit = [];

    //-

    for(i=0; i<_settings.quantity; i++){
        let _emitterParticle = _settings.particles[Math.randomInteger(0, _settings.particles.length-1)].clone();
        _emitterParticle.position.set(0,0,0);
        _emitterParticle.rotation.set(0,0,0);
        _emitterParticle.scale.set(1,1,1);

        if(_settings.cloneMaterial){
            _emitterParticle.material = _emitterParticle.material.clone();
        }

        _emitterParticle.visible = false;

        _emitterParticle.velocity 		= Object.assign({}, _settings.velocity);
        _emitterParticle.velocityAngular 	= Object.assign({}, _settings.velocityAngular);
        _emitterParticle.velocityOpacity 	= Object.assign({}, _settings.velocityOpacity);
        _emitterParticle.velocityScale 	= Object.assign({}, _settings.velocityScale);

        _emitter.arr_particles.push( _emitterParticle );

        _emitter.add( _emitterParticle );
    }

    //-

    _emitter.exude = THREE_Emitter_Exude;
    _emitter.update = THREE_Emitter_Update;

    //-

    app.emitters.list.push( _emitter );

    //-

    return _emitter;
}


function THREE_Emitter_Exude(_settings){
    let _emitter = this;
    let i,j;

    if(!_emitter.visible){ return false; }

    if(_emitter.v_tm == 0){
        _emitter.v_tm = _emitter.v_settings.frequency;

        //-

        _settings = Object.assign({

            quantity 		: 1,
            spawn 			: _emitter.v_settings.spawn,

        }, _settings);

        //-

        for(i=0; i<_settings.quantity; i++){
            let _emitterParticle = _emitter.arr_particles[_emitter.v_counter];

            //-

            _emitterParticle.visible = true;

            //-

            _emitterParticle.position.x = _settings.spawn.x + _settings.spawn.wx*Math.random();
            _emitterParticle.position.y = _settings.spawn.y + _settings.spawn.wy*Math.random();
            _emitterParticle.position.z = _settings.spawn.z + _settings.spawn.wz*Math.random();

            _emitterParticle.rotation.x = _emitter.v_settings.rotation.x + _emitter.v_settings.rotation.dx - _emitter.v_settings.rotation.dx*2*Math.random();
            _emitterParticle.rotation.y = _emitter.v_settings.rotation.y + _emitter.v_settings.rotation.dy - _emitter.v_settings.rotation.dy*2*Math.random();
            _emitterParticle.rotation.z = _emitter.v_settings.rotation.z + _emitter.v_settings.rotation.dz - _emitter.v_settings.rotation.dz*2*Math.random();

            if(_emitter.v_settings.scale.sync){
                _emitterParticle.scale.x = _emitter.v_settings.scale.x + _emitter.v_settings.scale.dx - _emitter.v_settings.scale.dx*2*Math.random();
                _emitterParticle.scale.y = _emitterParticle.scale.z = _emitterParticle.scale.x;
            }else{
                _emitterParticle.scale.x = _emitter.v_settings.scale.x + _emitter.v_settings.scale.dx - _emitter.v_settings.scale.dx*2*Math.random();
                _emitterParticle.scale.y = _emitter.v_settings.scale.y + _emitter.v_settings.scale.dy - _emitter.v_settings.scale.dy*2*Math.random();
                _emitterParticle.scale.z = _emitter.v_settings.scale.z + _emitter.v_settings.scale.dz - _emitter.v_settings.scale.dz*2*Math.random();
            }

            _emitterParticle.material.opacity = _emitter.v_settings.opacity.a + _emitter.v_settings.opacity.da - _emitter.v_settings.opacity.da*2*Math.random();

            if(_emitter.v_settings.opacity.easeIn){
                _emitterParticle.in_alpha = true;
                _emitterParticle.to_alpha = _emitterParticle.material.opacity;
                _emitterParticle.material.opacity = 0;
            }

            //-

            _emitterParticle.lifeframe			= Math.randomInteger(_emitter.v_settings.lifeframe.min, _emitter.v_settings.lifeframe.max);

            _emitterParticle.velocity.x 		= _emitter.v_settings.velocity.x + _emitter.v_settings.velocity.dx - _emitter.v_settings.velocity.dx*2*Math.random();
            _emitterParticle.velocity.y 		= _emitter.v_settings.velocity.y + _emitter.v_settings.velocity.dy - _emitter.v_settings.velocity.dy*2*Math.random();
            _emitterParticle.velocity.z 		= _emitter.v_settings.velocity.z + _emitter.v_settings.velocity.dz - _emitter.v_settings.velocity.dz*2*Math.random();
            _emitterParticle.velocityScale.x 	= _emitter.v_settings.velocityScale.x + _emitter.v_settings.velocityScale.dx - _emitter.v_settings.velocityScale.dx*2*Math.random();
            _emitterParticle.velocityScale.y 	= _emitter.v_settings.velocityScale.y + _emitter.v_settings.velocityScale.dy - _emitter.v_settings.velocityScale.dy*2*Math.random();
            _emitterParticle.velocityScale.z 	= _emitter.v_settings.velocityScale.z + _emitter.v_settings.velocityScale.dz - _emitter.v_settings.velocityScale.dz*2*Math.random();
            _emitterParticle.velocityOpacity.a 	= _emitter.v_settings.velocityOpacity.a + _emitter.v_settings.velocityOpacity.da - _emitter.v_settings.velocityOpacity.da*2*Math.random();
            _emitterParticle.velocityAngular.x 	= _emitter.v_settings.velocityAngular.x + _emitter.v_settings.velocityAngular.dx - _emitter.v_settings.velocityAngular.dx*2*Math.random();
            _emitterParticle.velocityAngular.y 	= _emitter.v_settings.velocityAngular.y + _emitter.v_settings.velocityAngular.dy - _emitter.v_settings.velocityAngular.dy*2*Math.random();
            _emitterParticle.velocityAngular.z 	= _emitter.v_settings.velocityAngular.z + _emitter.v_settings.velocityAngular.dz - _emitter.v_settings.velocityAngular.dz*2*Math.random();

            //-

            if(_emitter.v_settings.physics){

                THREE.calculateSize( _emitterParticle );

                //-

                if(_emitterParticle.children.length > 0){

                    for(j=0; j<_emitterParticle.children.length; j++){
                        THREE.calculateSize( _emitterParticle.children[j] );
                        _emitterParticle.children[j].visible = false;
                        _emitterParticle.children[j].type = "box";
                    }

                    THREE.addPhysics( _emitterParticle, {shapes:_emitterParticle.children, velocity:_emitterParticle.velocity, velocityAngular:_emitterParticle.velocityAngular});

                }else if(_emitterParticle.name.indexOf("Sphere") != -1){

                    THREE.addPhysics( _emitterParticle, {type:"sphere", velocity:_emitterParticle.velocity, velocityAngular:_emitterParticle.velocityAngular});

                }else if(_emitterParticle.name.indexOf("Cylinder") != -1){

                    THREE.addPhysics( _emitterParticle, {type:"cylinder", velocity:_emitterParticle.velocity, velocityAngular:_emitterParticle.velocityAngular});

                }else{

                    THREE.addPhysics( _emitterParticle, {velocity:_emitterParticle.velocity, velocityAngular:_emitterParticle.velocityAngular});

                }
            }

            //-

            if(_emitter.arr_emit.indexOf(_emitterParticle)==-1){
                _emitter.arr_emit.push( _emitterParticle );
            }

            //-

            _emitter.v_counter++;
            if(_emitter.v_counter == _emitter.v_settings.quantity){ _emitter.v_counter = 0; }
        }

    }
}

function THREE_Emitter_Update(){
    let _emitter = this;
    let i;

    //-

    if(!_emitter.visible){ return false; }

    //-

    if(_emitter.v_tm > 0){ _emitter.v_tm--; }

    //-

    for(i=_emitter.arr_emit.length-1; i>=0; i--){
        let _emitterParticle = _emitter.arr_emit[i];

        //-

        if(!_emitter.v_settings.physics){
            _emitterParticle.position.x 		+= _emitterParticle.velocity.x;
            _emitterParticle.position.y 		+= _emitterParticle.velocity.y;
            _emitterParticle.position.z 		+= _emitterParticle.velocity.z;

            if(_emitterParticle.material.isSpriteMaterial){
                _emitterParticle.material.rotation += _emitterParticle.velocityAngular.x;
            }else{
                _emitterParticle.rotation.x 	+= _emitterParticle.velocityAngular.x;
                _emitterParticle.rotation.y 	+= _emitterParticle.velocityAngular.y;
                _emitterParticle.rotation.z 	+= _emitterParticle.velocityAngular.z;
            }

            if(_emitterParticle.velocityScale.sync){
                _emitterParticle.scale.x 	+= _emitterParticle.velocityScale.x;
                _emitterParticle.scale.y 	= _emitterParticle.scale.x;
                _emitterParticle.scale.z 	= _emitterParticle.scale.x;
            }else{
                _emitterParticle.scale.x 	+= _emitterParticle.velocityScale.x;
                _emitterParticle.scale.y 	+= _emitterParticle.velocityScale.y;
                _emitterParticle.scale.z 	+= _emitterParticle.velocityScale.z;
            }

            //-

            _emitterParticle.velocity.x *= (1-_emitter.v_settings.friction.x);
            _emitterParticle.velocity.y *= (1-_emitter.v_settings.friction.y);
            _emitterParticle.velocity.z *= (1-_emitter.v_settings.friction.z);

            _emitterParticle.velocityScale.x *= (1-_emitter.v_settings.friction.sx);
            _emitterParticle.velocityScale.y *= (1-_emitter.v_settings.friction.sy);
            _emitterParticle.velocityScale.z *= (1-_emitter.v_settings.friction.sz);

            _emitterParticle.velocityAngular.x *= (1-_emitter.v_settings.friction.rx);
            _emitterParticle.velocityAngular.y *= (1-_emitter.v_settings.friction.ry);
            _emitterParticle.velocityAngular.z *= (1-_emitter.v_settings.friction.rz);

            _emitterParticle.velocityOpacity.a *= (1-_emitter.v_settings.friction.opacity);

            //-

            _emitterParticle.velocity.x += _emitter.v_settings.gravity.x;
            _emitterParticle.velocity.y += _emitter.v_settings.gravity.y;
            _emitterParticle.velocity.z += _emitter.v_settings.gravity.z;

        }

        if(_emitterParticle.in_alpha){
            _emitterParticle.material.opacity += 0.05;
            if(_emitterParticle.material.opacity >= _emitterParticle.to_alpha){
                _emitterParticle.in_alpha = false;
            }
        }else{
            if(_emitterParticle.material.opacity <= 1){
                _emitterParticle.material.opacity += _emitterParticle.velocityOpacity.a;
            }else{
                _emitterParticle.material.opacity = 1;
            }
        }

        //-

        if(_emitterParticle.lifeframe > 1){
            _emitterParticle.lifeframe--;
        }

        if(
            _emitterParticle.x < _emitter.v_settings.world.x ||
            _emitterParticle.x > _emitter.v_settings.world.x + _emitter.v_settings.world.wx ||
            _emitterParticle.y < _emitter.v_settings.world.y ||
            _emitterParticle.y > _emitter.v_settings.world.y + _emitter.v_settings.world.wy ||
            _emitterParticle.z < _emitter.v_settings.world.z ||
            _emitterParticle.z > _emitter.v_settings.world.z + _emitter.v_settings.world.wz ||
            _emitterParticle.material.opacity < 0 ||
            _emitterParticle.scale.x < 0 ||
            _emitterParticle.scale.y < 0 ||
            _emitterParticle.scale.z < 0 ||
            _emitterParticle.lifeframe == 1
        ){
            _emitterParticle.visible = false;
            _emitter.arr_emit.splice(i, 1);

            //-

            if(_emitter.v_settings.physics){
                THREE.removePhysics( _emitterParticle );
            }
        }

    }
}


//---------------------------------------------------------------------------------
//- THREE CHARACTER

function initLibThreeCharacter(){
    THREE.Character = THREE_Character;
}

function THREE_Character(_settings){

    _settings = Object.assign({

        model			: null,
        material 		: null,

        actionStandard 	: "Idle",

        autoMove		: true,
        isBoneAnimation	: true,

        stickMeshGround : null,

        castShadow 		: true,
        receiveShadow 	: true,
        frustumCulled 	: true,

        forceWalk 		: 3.0,
        forceRun 		: 6.0,
        forceJump 		: 3.0,

        wx 				: 0.2,
        wy 				: 0.2,
        wz 				: 0.2,

        isAI 			: true,
        tmAI 			: Math.randomInteger(0, 100),

    }, _settings);

    //-

    let _character = THREE.SkeletonUtils.clone(assets.models[_settings.model]);

    _character.v_data = assets.models[_settings.model].v_data;

    //-

    _character.traverse(function ( object ) {
        if(object.isMesh){
            if(_settings.material){
                object.material = _settings.material;
            }

            object.castShadow = _settings.castShadow;
            object.receiveShadow = _settings.receiveShadow;
            object.frustumCulled = _settings.frustumCulled;
        }

        _character[object.name] = object;
    });

    //-

    if(_character.animations){
        THREE_Character_Mixer( _character );
    }

    //-

    _character.isCharacter 			= true;
    _character.isPhysicCharacter 	= false;

    _character.wx 					= _settings.wx;
    _character.wy 					= _settings.wy;
    _character.wz 					= _settings.wz;

    _character.isAI 				= _settings.isAI;
    _character.tmAI 				= _settings.tmAI;

    _character.forceWalk 			= _settings.forceWalk;
    _character.forceRun 			= _settings.forceRun;
    _character.forceJump 			= _settings.forceJump;

    _character.actionStandard 		= _settings.actionStandard;
    _character.stickMeshGround 		= _settings.stickMeshGround;
    _character.autoMove 			= _settings.autoMove;
    _character.isBoneAnimation 		= _settings.isBoneAnimation;

    _character.angleVelocityCurrent = _character.rotation.y;
    _character.angleVelocity 		= _character.rotation.y;
    _character.positionTo 			= new THREE.Vector3( 0, 0, 0 );

    _character.navigationPath 		= [];
    _character.debugPoint0 			= new THREE.Group();
    _character.debugPoint1 			= new THREE.Group();
    _character.debugDirection 		= new THREE.Vector3();

    //-

    _character.update				= THREE_Character_Update;

    _character.setAction 			= THREE_Character_SetAction;
    _character.setActionPool 		= THREE_Character_SetActionPool;
    _character.setActionBoolean 	= THREE_Character_SetActionBoolean;

    _character.commandToPoint 		= THREE_Character_CommandToPoint;
    _character.commandDead 			= THREE_Character_CommandDead;

    //-

    _character.setActionBoolean("Idle");
    _character.setActionPool("Idle", 1, Math.random());

    //-

    app.characters3d.push( _character );

    //-

    return _character;
}

//------------------
//- Update

function THREE_Character_Update(){
    let i;
    let _character = this;
    let _app = app;

    //-

    if(!_character.visible){ return false; }

    //- action

    if(_character.isBoneAnimation){
        for(i in _character.action){
            let _action = _character.action[i];

            if(_action.name != _character.current_action){
                if(_action.weight > 0.0){
                    _action.weight -= 0.15;
                    if(_action.weight <= 0.0){
                        _action.weight = 0.0;
                        _action.stop();
                    }
                }
            }else{
                if(_action.weight < 1.0){
                    _action.weight += 0.15;
                    if(_action.weight >= 1.0){
                        _action.weight = 1.0;
                    }
                }
            }
        }
    }

    //- mixer

    if(_character.isBoneAnimation){
        _character.mixer.update( _character.action[_character.current_action].speed * _character.action[_character.current_action].speedK );
    }

    //- navigation

    if(_character.isAI && _character.autoMove){
        if(_character.isActionRun || _character.isActionWalk){
            if(_character.navigationPath.length > 0){
                let _pos = _character.navigationPath[0];
                let _d = Math.hypot(
                    (_pos.x - _character.position.x),
                    (_pos.z - _character.position.z)
                );

                if(_d < (_character.wx*0.5 + _character.forceRun*0.05)){
                    _character.navigationPath.splice(0, 1);
                }else{
                    let _a = Math.atan2(
                        (_pos.x - _character.position.x),
                        (_pos.z - _character.position.z)
                    );

                    _character.angleVelocity = _a;
                }
            }else{
                if(!_character.isActionDead){
                    _character.setActionBoolean("Idle");
                    _character.setActionPool("Idle", 0, 0);
                }
            }
        }
    }

    //- location

    if(!_character.isPhysicCharacter && _character.autoMove){

        //- rotation

        while(_character.angleVelocity - _character.angleVelocityCurrent > Math.PI){ _character.angleVelocity -= 2*Math.PI; }
        while(_character.angleVelocityCurrent - _character.angleVelocity > Math.PI){ _character.angleVelocity += 2*Math.PI; }

        _character.angleVelocityCurrent = _character.angleVelocity - 0.65*(_character.angleVelocity - _character.angleVelocityCurrent);

        _character.rotation.y = _character.angleVelocityCurrent;

        //- velocity

        if(_character.isActionWalk){
            _character.positionTo.x += _character.forceWalk * 0.01 * Math.sin(_character.angleVelocityCurrent);
            _character.positionTo.z += _character.forceWalk * 0.01 * Math.cos(_character.angleVelocityCurrent);
        }else if(_character.isActionRun){
            _character.positionTo.x += _character.forceRun * 0.01 * Math.sin(_character.angleVelocityCurrent);
            _character.positionTo.z += _character.forceRun * 0.01 * Math.cos(_character.angleVelocityCurrent);
        }

        //- position

        _character.position.x = _character.positionTo.x - 0.65*(_character.positionTo.x - _character.position.x);
        _character.position.y = _character.positionTo.y - 0.65*(_character.positionTo.y - _character.position.y);
        _character.position.z = _character.positionTo.z - 0.65*(_character.positionTo.z - _character.position.z);
    }

    //- stick ground

    if(_character.stickMeshGround && _character.parent){

        _character.parent.add( _character.debugPoint0 );
        _character.parent.add( _character.debugPoint1 );
        _character.debugPoint0.position.copy( _character.position );
        _character.debugPoint1.position.copy( _character.position );
        _character.debugPoint0.position.y += 2;
        _character.debugPoint1.position.y -= 2;
        _app.scene3d.attach( _character.debugPoint0 );
        _app.scene3d.attach( _character.debugPoint1 );

        _app.raycaster3d.set(
            _character.debugPoint0.position,
            _character.debugDirection.subVectors(_character.debugPoint1.position, _character.debugPoint0.position).normalize()
        );

        let _intersects = _app.raycaster3d.intersectObject(_character.stickMeshGround, false);
        if(_intersects.length > 0){
            _character.debugPoint0.position.copy( _intersects[0].point );
            _character.parent.attach( _character.debugPoint0 );
            _character.positionTo.y = _character.position.y = _character.debugPoint0.position.y;
        }

    }
}

//------------------
//- Commands

function THREE_Character_CommandToPoint(_positionTo){
    if(this.isActionDead){ 		return false; }
    if(this.isActionHit){ 		return false; }
    if(this.isActionAttack){ 	return false; }

    //-

    let _character = this;
    let _path = THREE.findFromNavigationMesh(_character.position, _positionTo);

    if(_path){
        _character.navigationPath = _path;

        _character.setActionBoolean("Run");
        _character.setActionPool("Run", 0, Math.random());
    }
}

function THREE_Character_CommandDead(){
    if(this.isActionDead){ return false; }

    let _character = this;

    //-

    _character.setActionBoolean("Dead");

    //-

    if(_character.isPhysicCharacter){
        THREE.removeCharacterPhysics(_character);
    }

    //-

    if(_character.actionPool["Dead"].length > 0){
        _character.setActionPool("Dead");
    }

}

//------------------
//- Actions

function THREE_Character_Mixer(_obj){
    let i = 0;

    //-

    _obj.mixer = new THREE.AnimationMixer( _obj );
    _obj.action = {};
    _obj.actionPool = {"Idle":[], "Walk":[], "Run":[], "Jump":[], "Attack":[], "Fail":[], "Dead":[], "Other":[]};

    //-

    for(i=0; i<_obj.v_data.animations.length; i++){
        _obj.action[ _obj.v_data.animations[i].name ] = _obj.mixer.clipAction( _obj.v_data.animations[i] );
        _obj.action[ _obj.v_data.animations[i].name ].name =  _obj.v_data.animations[i].name;
        _obj.action[ _obj.v_data.animations[i].name ].speed = 0.035;
        _obj.action[ _obj.v_data.animations[i].name ].speedK = 1+0.1-0.1*2*Math.random();
        _obj.action[ _obj.v_data.animations[i].name ].clampWhenFinished = true;

        if(_obj.v_data.animations[i].name.indexOf("Idle") != -1){
            _obj.actionPool["Idle"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopOnce);
        }else if(_obj.v_data.animations[i].name.indexOf("Walk") != -1){
            _obj.actionPool["Walk"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopRepeat);
        }else if(_obj.v_data.animations[i].name.indexOf("Run") != -1){
            _obj.actionPool["Run"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopRepeat);
        }else if(_obj.v_data.animations[i].name.indexOf("Jump") != -1){
            _obj.actionPool["Jump"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopOnce);
        }else if(_obj.v_data.animations[i].name.indexOf("Attack") != -1){
            _obj.actionPool["Attack"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopOnce);
        }else if(_obj.v_data.animations[i].name.indexOf("Fail") != -1){
            _obj.actionPool["Fail"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopOnce);
        }else if(_obj.v_data.animations[i].name.indexOf("Dead") != -1){
            _obj.actionPool["Dead"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopOnce);
        }else{
            _obj.actionPool["Other"].push( _obj.v_data.animations[i].name );
            _obj.action[ _obj.v_data.animations[i].name ].setLoop(THREE.LoopOnce);
        }
    }

    //-

    _obj.mixer.character = _obj;

    _obj.mixer.addEventListener('finished', THREE_Character_ActionFinished);

}

function THREE_Character_ActionFinished(e){
    if(e.target.character.action[e.target.character.current_action].paused && !e.target.character.isActionDead){
        if(e.target.character.current_action == "Fall_0" || e.target.character.current_action == "Fall_1"){
            if(e.target.character.v_life > 0){
                e.target.character.setActionPool("Up", 0, 0);
            }
        }else{
            e.target.character.setActionPool(e.target.character.actionStandard, 0, 0);
        }

    }
}

function THREE_Character_SetAction(_action, _weight, _seek){
    if(_weight == undefined){
        _weight = 1;
    }
    if(_seek == undefined){ 	_seek = 0; }

    //-

    if(this.actionPool[_action]){
        this.setActionBoolean( _action );
    }else{
        if(_action.indexOf("Idle") != -1){
            this.setActionBoolean("Idle");
        }else if(_action.indexOf("Run") != -1){
            this.setActionBoolean("Run");
        }else if(_action.indexOf("Walk") != -1){
            this.setActionBoolean("Walk");
        }else if(_action.indexOf("Attack") != -1){
            this.setActionBoolean("Attack");
        }else if(_action.indexOf("Hit") != -1){
            this.setActionBoolean("Hit");
        }else if(_action.indexOf("Dead") != -1){
            this.setActionBoolean("Dead");
        }else if(_action.indexOf("Jump") != -1){
            this.setActionBoolean("Jump");
        }else{
            this.setActionBoolean("Other");
        }
    }

    //-

    if(_action.indexOf("Idle") != -1 && this.isPhysicCharacter){
        this.physicsObject.velocity.x = 0;
        this.physicsObject.velocity.z = 0;
    }

    //-

    if(_weight == 1){
        this.mixer.stopAllAction();
    }

    //-

    if(this.action[this.current_action]){
        this.action[this.current_action].weight = (1 - _weight);
        this.action[this.current_action].paused = true;
    }

    if(this.current_action == _action){
        this.action[_action].reset();
        _weight = 1;
    }

    this.current_action = _action;

    //this.mixer.stopAllAction();
    this.mixer.time = _seek;
    this.action[_action].weight = _weight;
    this.action[_action].play();
    this.action[_action].enabled = true;
    this.action[_action].paused = false;
    this.mixer.update(0.001);

    //console.log(_action)
    //console.log(this.action[_action])

}

function THREE_Character_SetActionPool(_action, _weight, _seek){
    if(_weight == undefined){	_weight = 1; }
    if(_seek == undefined){ 	_seek = 0; }

    //-

    if(this.actionPool[_action]){
        if(this.actionPool[_action].length > 0){
            Math.mixArray( this.actionPool[_action] );
            this.setAction( this.actionPool[_action][0], _weight, _seek );
        }
    }else{
        this.setAction(_action, _weight, _seek );
    }

}

function THREE_Character_SetActionBoolean(_actionPool){
    this.isActionIdle 	= false;
    this.isActionWalk 	= false;
    this.isActionRun 	= false;
    this.isActionJump 	= false;
    this.isActionAttack = false;
    this.isActionHit 	= false;
    this.isActionDead 	= false;

    this["isAction"+_actionPool] = true;
}


//---------------------------------------------------------------------------------
//- THREE ANIMATION SPRITE

function initLibThreeAnimationSprite(){
    THREE.AnimationSprite = THREE_AnimationSprite;
}

function THREE_AnimationSprite(_material, _sizeW, _sizeH, _loop){
    let _sprite = new THREE.Sprite(_material);

    //-

    _material.map.repeat.set( 1/_sizeW, 1/_sizeH );
    _material.map.flipY = true;

    _sprite.frame = -1;
    _sprite.wFrame = _sizeW;
    _sprite.hFrame = _sizeH;
    _sprite.isLoop = _loop;

    //-

    _sprite.update = THREE_AnimationSprite_Update;

    _sprite.update();

    //-

    return _sprite;
}

function THREE_AnimationSprite_Update(){
    this.frame += 1;
    this.frameInt = Math.round(this.frame);

    if(this.frameInt >= this.wFrame*this.hFrame){
        if(this.isLoop){
            this.frame = 0;
            this.frameInt = 0;
        }else{
            this.visible = false;
        }
    }else{
        this.v_kx = this.frameInt % this.hFrame;
        this.v_ky = Math.floor( this.frameInt / this.hFrame );

        this.material.map.offset.x = this.v_kx/this.hFrame;
        this.material.map.offset.y = -1/this.hFrame + this.hFrame - this.v_ky/this.hFrame;
    }
}


function initLibThreeCustomCanvasTexture(){
    THREE.CustomCanvasTexture = THREE_CustomCanvasTexture;
}

function THREE_CustomCanvasTexture(_size, _mask, _update){
    let ct_canvas = document.createElement('canvas');
    ct_canvas.style.visibility = "hidden";
    let ct_ctx = ct_canvas.getContext && ct_canvas.getContext('2d');
    document.getElementById('main').appendChild( ct_canvas );

    ct_canvas.width = _size;
    ct_canvas.height = _size;

    //-

    let ct_canvas_mask;
    let ct_ctx_mask;

    if(_mask){
        ct_canvas_mask = document.createElement('canvas');
        ct_canvas_mask.style.visibility = "hidden";
        ct_ctx_mask = ct_canvas_mask.getContext && ct_canvas_mask.getContext('2d');
        document.getElementById('main').appendChild( ct_canvas_mask );

        ct_canvas_mask.width = _size;
        ct_canvas_mask.height = _size;
    }

    //-

    let ct_texture = new THREE.CanvasTexture( ct_canvas );
    ct_texture.v_canvas = ct_canvas;
    ct_texture.v_ctx = ct_ctx;
    ct_texture.v_canvas_mask = ct_canvas_mask;
    ct_texture.v_ctx_mask = ct_ctx_mask;
    ct_texture.v_size = _size;
    //ct_texture.flipY = false;
    ct_texture.encoding = THREE.sRGBEncoding;

    ct_texture.update = _update;

    return ct_texture;
}

function shaderStochastic(shader, renderer){

    shader.uniforms.uTextureA		= { value: null };
    //shader.uniforms.uTextureB 	= { value: null };
    //shader.uniforms.uTextureBM 	= { value: null };
    shader.uniforms.uRepeatUV 		= { value: 20.0 };
    shader.uniforms.uRepeatTile 	= { value: 20.0 };

    //-

    app.shaders.materials.push(this);

    //-

    let shaderHeaderVertex = '';
    shaderHeaderVertex += `
		varying vec2 vUv;	
	`;

    shader.vertexShader = shaderHeaderVertex + shader.vertexShader;
    shader.vertexShader = shader.vertexShader.replace(
        '#include <begin_vertex>',
        `
			//'#include <begin_vertex>
			
			vUv = uv;
			vec3 transformed = vec3(position);

		`
    );

    //-

    let shaderHeaderFragment = '';
    shaderHeaderFragment += `
		varying vec2 vUv;
		uniform sampler2D uTextureA;
		//uniform sampler2D uTextureB;
		//uniform sampler2D uTextureBM;
		uniform float uRepeatUV;
		uniform float uRepeatTile;
		
		vec2 uvHash(vec2 s){
			return fract(sin(mod(vec2(dot(s, vec2(127.1, 311.7)), dot(s, vec2(269.5,183.3))), 3.14159))*43758.5453);
		}
		
		vec2 uvRotation(vec2 p_input, float p_theta){
			mat2 l_rot_matrix = mat2(cos(p_theta), -sin(p_theta), sin(p_theta),  cos(p_theta));
			return (l_rot_matrix * p_input);
		}
		
		int mod3( int n ){
			return (n<0) ? 2-((2-n)%3) : n%3;
		}

		ivec2 getHexagonID( in vec2 p ){
			vec2 q = vec2( p.x, p.x*0.5+p.y*0.8660254037 );

			ivec2 i = ivec2(floor(q));
			vec2 f = fract(q);
			
			int v = mod3(i.x + i.y);
			ivec2 id = i + v;
			if( v==2 ){ id -= (f.x>f.y)?ivec2(1,2):ivec2(2,1); }
			
			return ivec2( id.x, (2*id.y - id.x)/3 );
		}

		vec4 textureStochasticHex(sampler2D TEXTURE, vec2 UV, float REPEAT_UV, float REPEAT_TILE){	
			vec2 UVR_1 = UV*REPEAT_TILE;	
			UVR_1.x += UVR_1.y * 0.25;
			UVR_1.y -= UVR_1.x * 0.25;
			UVR_1.x += 4.8;
			UVR_1.y += 2.8;
			
			ivec2 hId_0 = getHexagonID(UV*REPEAT_TILE);
			vec3 colorNoise_0 = vec3(0.3+0.2*sin(float(15*hId_0.x)+cos(float(33*hId_0.y))));
			
			ivec2 hId_1 = getHexagonID(UVR_1);
			vec3 colorNoise_1 = vec3(0.3+0.2*sin(float(15*hId_1.x)+cos(float(33*hId_1.y))));
			
			vec4 colorStochasticA = texture2D(TEXTURE, REPEAT_UV * uvRotation(UV, 7.0*colorNoise_0.r));
			vec4 colorStochasticB = texture2D(TEXTURE, REPEAT_UV * uvRotation(UV, 7.0*colorNoise_1.r));
			
			vec4 colorStochastic = 3.0*pow(mix(colorStochasticA, colorStochasticB, 0.5), vec4(2.0, 2.0, 2.0, 1.0));
			
			return colorStochastic;
		}
		
		vec4 textureStochasticRect(sampler2D TEXTURE, vec2 UV, float REPEAT_UV, float REPEAT_TILE){
			
			vec2 UVS_0 = UV*REPEAT_TILE;						
			
			vec2 UVS_1 = (UV)*REPEAT_TILE;						
			UVS_1.x += UVS_1.y * 0.2;
			UVS_1.y -= UVS_1.x * 0.5;
			
			vec2 UVS_2 = UV*REPEAT_TILE;						
			UVS_2.x += UVS_2.y * 0.8;
			UVS_2.y -= UVS_2.x * 0.8;
			UVS_2.x += 4.8;
			UVS_2.y += 2.8;
			
			float numNoise_0 = uvHash(floor(UVS_0)).r;
			float numNoise_1 = uvHash(floor(UVS_1)).r;
			float numNoise_2 = uvHash(floor(UVS_2)).r;
					
			vec4 colorStochasticA = texture2D(TEXTURE, REPEAT_UV * uvRotation(UV, 7.0*numNoise_0));
			vec4 colorStochasticB = texture2D(TEXTURE, REPEAT_UV * uvRotation(UV, 7.0*numNoise_1));
			vec4 colorStochasticC = texture2D(TEXTURE, REPEAT_UV * uvRotation(UV, 7.0*numNoise_2));
			
			vec4 colorStochastic = 3.0*pow(mix(colorStochasticA, colorStochasticB, 0.5), vec4(2.0, 2.0, 2.0, 1.0));
			colorStochastic = mix(colorStochastic, colorStochasticC, 0.5);
			
			return colorStochastic;
			
		}		
	`;

    shader.fragmentShader = shaderHeaderFragment + shader.fragmentShader;
    shader.fragmentShader = shader.fragmentShader.replace(
        '#include <output_fragment>',
        `
			#include <output_fragment>
			
			//-
			
			//vec4 colorA = textureStochasticHex(uTextureA, vUv, 20.0, 20.0);
			vec4 colorA = textureStochasticRect(uTextureA, vUv, uRepeatUV, uRepeatTile);
			//vec4 colorB = textureStochasticRect(uTextureA, vUv, uRepeatUV, uRepeatTile);
			//vec4 colorBMask = texture2D(uTextureBM, vUv);
			//vec3 colorResult = mix(colorA.rgb, colorB.rgb, colorBMask.r);	
			
			gl_FragColor.r *= colorA.r;
			gl_FragColor.g *= colorA.g;
			gl_FragColor.b *= colorA.b;
			
		`
    );

    //-

    this.userData.shader = shader;
};

function shaderDissolution(shader, renderer){

    shader.uniforms.uTextureNoise 		= { value: assets.textures.three["vfx_noise_0"] };
    shader.uniforms.uRotation 			= { value: 0.0 };
    shader.uniforms.uDissolution 		= { value: 1.0 };
    shader.uniforms.scaleDissolution 	= { value: 0.5 };

    //-

    app.shaders.materials.push(this);

    //-

    let shaderHeaderVertex = '';
    shaderHeaderVertex += `
	
		varying vec2 vUv;
		uniform float uRotation;
		
	`;

    shader.vertexShader = shaderHeaderVertex + shader.vertexShader;
    shader.vertexShader = shader.vertexShader.replace(
        '#include <begin_vertex>',
        `
			//'#include <begin_vertex>
			
			vUv = uv;
			
			vec3 positionR = vec3(position);
			
			positionR.x = position.x * cos(uRotation) - position.y * sin(uRotation);
			positionR.y = position.x * sin(uRotation) + position.y * cos(uRotation);
			
			vec3 transformed = vec3(positionR);

		`
    );

    //-

    let shaderHeaderFragment = '';
    shaderHeaderFragment += `
		varying vec2 vUv;
		uniform sampler2D uTextureNoise;
		uniform float uDissolution;
		uniform float scaleDissolution;

	`;

    shader.fragmentShader = shaderHeaderFragment + shader.fragmentShader;
    shader.fragmentShader = shader.fragmentShader.replace(
        '#include <output_fragment>',
        `
			#include <output_fragment>
			
			//-
			
			vec4 colorNoise = texture2D(uTextureNoise, vUv*scaleDissolution);
			float limitDissolution = uDissolution + 1.0;		
			float kDissolution = limitDissolution - colorNoise.r*2.0;
			if(kDissolution < 0.0){
				kDissolution = 0.0;
			}else if(kDissolution > 1.0){
				kDissolution = 1.0;
			}
			
			gl_FragColor.a *= kDissolution;
						
		`
    );

    //-

    this.userData.shader = shader;
};

function shaderWind(shader, renderer){

    shader.uniforms.uTime		= { value: 0.0 };
    shader.uniforms.uStrengthX 	= { value: 0.1 };
    shader.uniforms.uStrengthY 	= { value: 0.1 };
    shader.uniforms.uStrengthZ 	= { value: 0.1 };
    shader.uniforms.uSpeed 		= { value: 1.0 };

    //-

    app.shaders.materials.push(this);

    //-

    let shaderHeaderVertex = '';
    shaderHeaderVertex += `
		varying vec2 vUv;
		
		attribute float color;

		uniform float uTime;
		uniform float uStrengthX;	
		uniform float uStrengthY;	
		uniform float uStrengthZ;	
		uniform float uSpeed;	
		
		float noiseA(vec2 n){ return fract(sin(dot(n, vec2(12.9898, 4.1414))) * 43758.5453); }	
	`;

    shader.vertexShader = shaderHeaderVertex + shader.vertexShader;
    shader.vertexShader = shader.vertexShader.replace(
        '#include <begin_vertex>',
        `
			//'#include <begin_vertex>
			
			vUv = uv;
			
			vec4 globalPos = modelMatrix * vec4(position, 1.0);

			vec3 newPos = vec3(position);
			
			float dx = uStrengthX * color;
			float dy = uStrengthY * color;
			float dz = uStrengthZ * color;
			
			float sinx = sin(globalPos.x*10.0 + uSpeed*2.1*uTime);
			float siny = sin(globalPos.y*10.0 + uSpeed*2.5*uTime);
			float sinz = sin(globalPos.z*10.0 + uSpeed*2.9*uTime);
			
			newPos.x += (dx*0.5 + dx * sinx); //* noiseA(uv*1.0)
			newPos.y += (dy*0.5 + dx * siny); //* noiseA(uv*1.0)
			newPos.z += (dz*0.5 + dx * sinz); //* noiseA(uv*1.0)
					
			vec3 transformed = vec3(newPos);

		`
    );

    //-

    this.userData.shader = shader;
};

function shaderWater(shader, renderer){

    shader.uniforms.uTextureNoise 	= { value: assets.textures.three["vfx_noise_0"] };
    shader.uniforms.uTime			= { value: 0.0 };

    //-

    app.shaders.materials.push(this);

    //-

    let shaderHeaderVertex = '';
    shaderHeaderVertex += `
		varying vec2 vUv;
	`;

    shader.vertexShader = shaderHeaderVertex + shader.vertexShader;
    shader.vertexShader = shader.vertexShader.replace(
        '#include <begin_vertex>',
        `
			//'#include <begin_vertex>
			
			vUv = uv;
			vec3 transformed = vec3(position);			

		`
    );

    //-

    let shaderHeaderFragment = '';
    shaderHeaderFragment += `
		varying vec2 vUv;
		
		uniform sampler2D uTextureNoise;
		uniform float uTime;
	`
    //console.log(shader.fragmentShader)
    shader.fragmentShader = shaderHeaderFragment + shader.fragmentShader;
    shader.fragmentShader = shader.fragmentShader.replace(
        '#include <output_fragment>',
        `
			#include <output_fragment>
			
			vec4 colorNoiseA = texture2D(uTextureNoise, vec2(vUv.x * 5.0 + 0.10*uTime, vUv.y * 6.0 + 0.04*uTime));
			vec4 colorNoiseB = texture2D(uTextureNoise, vec2(vUv.x * 8.0 + 0.06*uTime, vUv.y * 3.0 + 0.08*uTime));
			vec4 colorNoise = colorNoiseA * colorNoiseB;			
			if(colorNoise.r < 0.15){
				colorNoise.r = 0.0;
				colorNoise.g = 0.0;
				colorNoise.b = 0.0;
			}
			vec4 colorA = texture2D(uTextureNoise, vec2(vUv.x + 0.30*colorNoise.r, vUv.y + 0.05*colorNoise.r));
			
			gl_FragColor.r += 2.0*colorNoise.r;
			gl_FragColor.g += 2.0*colorNoise.g;
			gl_FragColor.b += 2.0*colorNoise.b;
		`
    );

    //-

    this.userData.shader = shader;
};

function shaderVerticalFog(shader, renderer){

    shader.uniforms.uFog 		= { value: new THREE.Color(0xffffff) };
    shader.uniforms.uYTop 		= { value: 0.5 };
    shader.uniforms.uYBottom 	= { value: -0.5 };

    //-

    app.shaders.materials.push(this);

    //-

    let shaderHeaderVertex = '';
    shaderHeaderVertex += `
		varying vec2 vUv;
		varying float vY;
	`;

    shader.vertexShader = shaderHeaderVertex + shader.vertexShader;
    shader.vertexShader = shader.vertexShader.replace(
        '#include <begin_vertex>',
        `
			//'#include <begin_vertex>
			
			vUv = uv;
			vec3 transformed = vec3(position);			
			
			vec4 vPos = modelMatrix * vec4( position, 1.0 );
			vY = vPos.y;
			
		`
    );

    //-

    let shaderHeaderFragment = '';
    shaderHeaderFragment += `
		varying vec2 vUv;
		varying float vY;
		
		uniform vec3 uFog;
		uniform float uYTop;
		uniform float uYBottom;
		
	`
    //console.log(shader.fragmentShader)
    shader.fragmentShader = shaderHeaderFragment + shader.fragmentShader;
    shader.fragmentShader = shader.fragmentShader.replace(
        '#include <output_fragment>',
        `
			#include <output_fragment>
			
			float m = smoothstep(uYTop, uYBottom, vY);
			vec3 colorFog = uFog;

			gl_FragColor.rgb = mix(gl_FragColor.rgb, colorFog, m);
		`
    );

    //-

    this.userData.shader = shader;
};

function shaderFire(shader, renderer){

    shader.uniforms.uTextureA 		= { value: assets.textures.three["vfx_fire"] };
    shader.uniforms.uTextureNoise 	= { value: assets.textures.three["vfx_noise_0"] };
    shader.uniforms.uTime			= { value: 0.0 };

    //-

    app.shaders.materials.push(this);

    //-

    let shaderHeaderVertex = '';
    shaderHeaderVertex += `
		varying vec2 vUv;
	`;

    shader.vertexShader = shaderHeaderVertex + shader.vertexShader;
    shader.vertexShader = shader.vertexShader.replace(
        '#include <begin_vertex>',
        `
			//'#include <begin_vertex>
			
			vUv = uv;
			vec3 transformed = vec3(position);			

		`
    );

    //-

    let shaderHeaderFragment = '';
    shaderHeaderFragment += `
		varying vec2 vUv;
		
		uniform sampler2D uTextureNoise;
		uniform sampler2D uTextureA;
		uniform float uTime;
	`


    shader.fragmentShader = shaderHeaderFragment + shader.fragmentShader;
    shader.fragmentShader = shader.fragmentShader.replace(
        '#include <output_fragment>',
        `
			#include <output_fragment>
			
			vec4 colorNoiseA = texture2D(uTextureNoise, vec2(vUv.x * 2.3, vUv.y * 0.2 - 0.45*uTime));
			vec4 colorNoiseB = texture2D(uTextureNoise, vec2(vUv.x * 1.8, vUv.y * 0.7 - 0.60*uTime));
			vec4 colorNoise = colorNoiseA * colorNoiseB;			
			
			vec4 colorA = texture2D(uTextureA, vec2(vUv.x*1.0, vUv.y*0.5+0.5 - 0.5*colorNoise.r));
			
			colorA.rgb = pow(colorA.rgb, vec3(3.0, 3.0, 3.0));
			
			gl_FragColor.rgba = colorA.rgba;
			
		`
    );

    //-

    this.userData.shader = shader;
};


