//- UTILITY MATH

Math.randomInteger = function (min, max) {
    let rand = min + Math.random() * (max + 1 - min);
    return Math.floor(rand);
}

Math.turnPoint = function(_point, _center, _angle) {
    let _x = _point.x;
    let _y = _point.y;
    let _cx = _center.x;
    let _cy = _center.y;

    _point.x = _cx + (_x - _cx)*Math.cos(_angle) - (_y - _cy)*Math.sin(_angle);
    _point.y = _cy + (_x - _cx)*Math.sin(_angle) - (_y - _cy)*Math.cos(_angle);
}

Math.sortY = function ( a, b ) {
    if ( a.y < b.y ){
        return -1;
    }
    if ( a.y > b.y ){
        return 1;
    }
    return 0;
}

Math.mixArray = function (array) {
    let currentIndex = array.length, temporaryValue, randomIndex;

    while (0 !== currentIndex) {
        randomIndex = Math.floor(Math.random() * currentIndex);
        currentIndex -= 1;

        temporaryValue = array[currentIndex];
        array[currentIndex] = array[randomIndex];
        array[randomIndex] = temporaryValue;
    }

    return array;
}


