function PIXI_addPhysics(_obj, _settings){
    let i;

    //-

    if(_settings == undefined){ _settings = {}; }

    //-

    _settings = Object.assign({

        mass					: 1,

        allowSleep				: true,
        material				: null,

        fixedX					: false,
        fixedY					: false,
        fixedRotation			: false,

        velocity				: {x:0, y:0},
        angularVelocity			: 0,

        damping					: 0.1,
        angularDamping			: 0.1,

        shape					: "box",
        shapes					: [],

    }, _settings);

    //-

    if(_obj.physicsObject){
        PIXI.removePhysics( _obj );
    }

    //-

    _obj.physicsObject = new p2.Body({
        mass					: _settings.mass,

        position				: [_obj.x, _obj.y],
        angle					: _obj.rotation,

        damping					: _settings.damping,
        angularDamping			: _settings.angularDamping,

        fixedX					: _settings.fixedX,
        fixedY					: _settings.fixedY,
        fixedRotation			: _settings.fixedRotation,

        allowSleep				: _settings.allowSleep,
        material				: _settings.material,

        velocity				: [_settings.velocity.x, _settings.velocity.y],
        angularVelocity			: _settings.angularVelocity,

    });

    _obj.physicsObject.pixiObject = _obj;

    //-

    if(_settings.shapes.length > 0){
        for(i=0; i<_settings.shapes.length; i++){
            PIXI_addPhysicsShape( _obj, _settings.shapes[i] );
        }
    }else{
        PIXI_addPhysicsShape( _obj, _settings );
    }

    //-

    if(_settings.material){
        _obj.physicsObject.material = _settings.material;
    }

    //-

    app.worldPhysics2D.addBody( _obj.physicsObject );

}

function PIXI_addPhysicsShape(_obj, _settings){
    let _shape;

    if(_settings == undefined){ _setting = {}; }

    _settings = Object.assign({

        shape 			: "box",

        wx 				: _obj.wx,
        wy 				: _obj.wy,

        length 			: 1,
        radius 			: 2,

        vertices 		: [],

        position 		: [0,0],
        angle 			: 0,

    }, _settings);

    //-

    if(_settings.shape == "box"){

        _shape = new p2.Box({
            width	: _settings.wx,
            height	: _settings.wy
        });

    }else if(_settings.shape == "circle"){

        _shape = new p2.Circle({
            radius : _settings.wx*0.5
        });

    }else if(_settings.shape == "capsule"){

        _shape = new p2.Capsule({
            length : _settings.length,
            radius : _settings.radius,
        });

    }else if(_settings.shape == "plane"){

        _shape = new p2.Plane();

    }else if(_settings.shape == "convex"){

        _shape = new p2.Convex({
            vertices : _settings.vertices
        });

    }else if(_settings.shape == "polygon"){

        //fromPolygon

    }

    _obj.physicsObject.addShape(_shape, _settings.position, _settings.angle);
}


