//- THREE MATH

function THREE_positionTo2d( _obj ){
    let vector = new THREE.Vector3();

    let widthHalf = 0.5*app.renderer3d.getContext().canvas.width;
    let heightHalf = 0.5*app.renderer3d.getContext().canvas.height;

    _obj.updateMatrixWorld();
    vector.setFromMatrixPosition(_obj.matrixWorld);
    vector.project(app.camera3d);

    vector.x = +(vector.x * widthHalf) + widthHalf;
    vector.y = -(vector.y * heightHalf) + heightHalf;

    let _scaleFactor = app.scaleFactor;

    if(window.innerWidth > 1280 || window.innerHeight > 1280){
        _scaleFactor = 1.0;
    }

    return {
        x: vector.x/(_scaleFactor * window.innerWidth) - 0.5,
        y: vector.y/(_scaleFactor * window.innerHeight) - 0.5
    };
};

function THREE_calculateSize(object){
    let _quaternion = new THREE.Quaternion();
    let _rx = object.rotation.x;
    let _ry = object.rotation.y;
    let _rz = object.rotation.z;
    _quaternion.copy( object.quaternion);

    object.rotation.set(0,0,0);

    let box = new THREE.Box3().setFromObject( object );
    let _size = box.getSize( new THREE.Vector3() );

    if(!_size.x){
        _size = object.geometry.boundingBox.getSize( new THREE.Vector3() );
    }

    object.applyQuaternion( _quaternion );

    object.wx = _size.x;
    object.wy = _size.y;
    object.wz = _size.z;
}


