//--------------------

function THREE_updatePhysics(){

    app.worldPhysics3D.step(1/40);

    //-

    let _arr = app.worldPhysics3D.bodies;

    for(let i=_arr.length-1; i>=0; i--){
        let _objPhs = _arr[i];

        //-

        if(!_objPhs.threeObject.isPhysicCharacter){

            _objPhs.threeObject.position.copy( _objPhs.position );
            _objPhs.threeObject.quaternion.copy( _objPhs.quaternion );

        }else{

            //- phs

            _objPhs.threeObject.positionTo.copy( _objPhs.position );
            _objPhs.threeObject.quaternion.copy( _objPhs.quaternion );

            //- rotation

            while(_objPhs.threeObject.angleVelocity - _objPhs.threeObject.angleVelocityCurrent > Math.PI){ _objPhs.threeObject.angleVelocity -= 2*Math.PI; }
            while(_objPhs.threeObject.angleVelocityCurrent - _objPhs.threeObject.angleVelocity > Math.PI){ _objPhs.threeObject.angleVelocity += 2*Math.PI; }

            _objPhs.threeObject.angleVelocityCurrent = _objPhs.threeObject.angleVelocity - 0.65*(_objPhs.threeObject.angleVelocity - _objPhs.threeObject.angleVelocityCurrent);

            _objPhs.threeObject.angleQuaternion.setFromAxisAngle( _objPhs.threeObject.axisY, _objPhs.threeObject.angleVelocityCurrent );
            _objPhs.quaternion = _objPhs.threeObject.angleQuaternion;

            //- velocity

            if(_objPhs.threeObject.isActionWalk){
                _objPhs.velocity.x = +_objPhs.threeObject.forceWalk * Math.sin(_objPhs.threeObject.angleVelocityCurrent);
                _objPhs.velocity.z = +_objPhs.threeObject.forceWalk * Math.cos(_objPhs.threeObject.angleVelocityCurrent);
            }else if(_objPhs.threeObject.isActionRun){
                _objPhs.velocity.x = +_objPhs.threeObject.forceRun * Math.sin(_objPhs.threeObject.angleVelocityCurrent);
                _objPhs.velocity.z = +_objPhs.threeObject.forceRun * Math.cos(_objPhs.threeObject.angleVelocityCurrent);
            }

            //- position

            _objPhs.threeObject.positionTo.y -= _objPhs.threeObject.wy*0.5;

            _objPhs.threeObject.position.x = _objPhs.threeObject.positionTo.x - 0.65*(_objPhs.threeObject.positionTo.x - _objPhs.threeObject.position.x);
            _objPhs.threeObject.position.y = _objPhs.threeObject.positionTo.y - 0.65*(_objPhs.threeObject.positionTo.y - _objPhs.threeObject.position.y);
            _objPhs.threeObject.position.z = _objPhs.threeObject.positionTo.z - 0.65*(_objPhs.threeObject.positionTo.z - _objPhs.threeObject.position.z);
        }

    }
}

