function THREE_addPhysicsShape(_mesh, _settings){
    let _shape;

    if(_settings == undefined){ _setting = {}; }

    _settings = Object.assign({

        shape 			: "box",

        wx 				: _mesh.wx,
        wy 				: _mesh.wy,
        wz 				: _mesh.wz,

        rTop 			: _mesh.wx*0.5,
        rBottom 		: _mesh.wx*0.5,
        height			: _mesh.wy,
        numSegments 	: 12,

        position 		: new CANNON.Vec3(),
        quaternion 		: new CANNON.Quaternion(),

    }, _settings);

    //-

    if(_settings.shape == "box"){

        _shape = new CANNON.Box(new CANNON.Vec3(
            _settings.wx*0.5,
            _settings.wy*0.5,
            _settings.wz*0.5
        ));

    }else if(_settings.shape == "sphere"){

        _shape = new CANNON.Sphere( _settings.wx*0.5 );

    }else if(_settings.shape == "cylinder"){

        _shape = new CANNON.Cylinder(
            _settings.rTop,
            _settings.rBottom,
            _settings.height,
            _settings.numSegments
        );

    }

    _mesh.physicsObject.addShape(_shape, _settings.position, _settings.quaternion);
}
