function moveTrain(){

    let _app = app;
    let _app_obj2d = _app.obj2d;
    let _app_obj3d = _app.obj3d;


    let i,j,k,d,a;
    let objTemp;
    let objTempExtra;
    let objTempHero = _app_obj3d["objWorld"]["mTrain"];


    if(objTempHero.speed_angle_val >0){

        //--

        objTempHero.a += 30;
        if(objTempHero.a >= 360){
            objTempHero.a -= 360;
        }
        objTempHero.scale.set(1+0.02*Math.sin(objTempHero.a*toRAD),1+0.02*Math.cos(objTempHero.a*toRAD),1+0.02*Math.sin(objTempHero.a*toRAD));


        objTempHero.v_angle = Math.atan2(
            (app.obj3d["objMapCaell_"+objTempHero.path[0].i+objTempHero.path[0].j].position.x - objTempHero.position.x),
            (app.obj3d["objMapCaell_"+objTempHero.path[0].i+objTempHero.path[0].j].position.z - objTempHero.position.z)
        )
        if(Math.hypot(
                app.obj3d["objMapCaell_"+objTempHero.path[0].i+objTempHero.path[0].j].position.x - objTempHero.position.x,
                app.obj3d["objMapCaell_"+objTempHero.path[0].i+objTempHero.path[0].j].position.z- objTempHero.position.z)
            < objTempHero.speed_angle_val){

            objTempHero.point = { i:objTempHero.path[1].i, j:objTempHero.path[1].j }
            objTempHero.oldPoint = { i:objTempHero.path[0].i, j:objTempHero.path[0].j }
            objTempHero.path = searchTrainPath([],objTempHero.point.i, objTempHero.point.j);

            //cons( { i:objTempHero.path[1].i, j:objTempHero.path[1].j } )

        }

        objTempHero.position.x += objTempHero.speed_angle_val*Math.sin( objTempHero.v_angle )
        objTempHero.position.z += objTempHero.speed_angle_val*Math.cos( objTempHero.v_angle )

        objTempHero.to_x = objTempHero.position.x;
        objTempHero.to_z = objTempHero.position.z;

        objTempHero.to_ry = objTempHero.v_angle;

        while(objTempHero.to_ry  >= 2*Math.PI){ objTempHero.to_ry  -= 2*Math.PI };
        while(objTempHero.to_ry  < 0){ objTempHero.to_ry += 2*Math.PI };

        while(objTempHero.to_ry - objTempHero.rotation.y > Math.PI){ objTempHero.to_ry -= 2*Math.PI; }
        while(objTempHero.rotation.y - objTempHero.to_ry > Math.PI){ objTempHero.to_ry += 2*Math.PI; }

        objTempHero.rotation.y = objTempHero.to_ry //- 0.70*(objTempHero.to_ry - objTempHero.rotation.y)

        //--

        objTempHero.old_x = objTempHero.position.x;
        objTempHero.old_z = objTempHero.position.z;

        objTempHero.to_dX = objTempHero.position.x;
        objTempHero.to_dZ = objTempHero.position.z;

        let _point = app.obj3d["objWorld"]["mTrain"].aObjsPoints[ app.obj3d["objWorld"]["mTrain"].idObjsPoints ]

        _point.x = objTempHero.position.x;
        _point.z = objTempHero.position.z;
        _point.rY = objTempHero.to_ry;

        objTempHero.aPathPoints.unshift( _point )
        if(objTempHero.aPathPoints.length>200){
            objTempHero.aPathPoints.pop();
        }

        app.obj3d["objWorld"]["mTrain"].idObjsPoints++;
        if(app.obj3d["objWorld"]["mTrain"].idObjsPoints>=200){
            app.obj3d["objWorld"]["mTrain"].idObjsPoints = 0
        }
    }
}

